import './App.css';
import Nav from './components/Nav';
import {BrowserRouter,Routes,Route} from 'react-router-dom'
import Footer from './components/Footer';
import SignUp from './components/SignUp';
import PrivateComponent from './components/PrivateComponent';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Nav></Nav>
      <Routes>
        <Route element={<PrivateComponent/>}>
        <Route path='/' element={<h1>Product Component</h1>}/>
        <Route path='/add' element={<h1>AddProduct Component</h1>}/>
        <Route path='/update' element={<h1>UpdateProduct Component</h1>}/>
        <Route path='/logout' element={<h1>LogoutProduct Component</h1>}/>
        <Route path='/profile' element={<h1>ProfileProduct Component</h1>}/>
        <Route path='/signup' element={<SignUp />}/>
        </Route>
      </Routes>



      </BrowserRouter>



    <Footer/>


    </div>
  );
}

export default App;
